@media (min-width: 64em) {
    ///styles go here
}

//640px, 1024px, 1400px
$breakpoints-up:("medium":"45em", "large":"64em");
//639px, 1024px, 1399px
$breakpoints-down:("small":"40em", "medium":"45em", "large":"64em");
@mixin breakpoint-up($size) {
    @media (min-width: map-get($breakpoints-up, $size)) {
        @content;
    }
}

@mixin breakpoint-down($size) {
    @media (max-width: map-get($breakpoints-down, $size)) {
        @content;
    }
}

@mixin bgConfig {
    background-size: cover;
    background-position: center center;
}

.scrolling-wrapper {
    overflow-x: scroll;
    max-width: 1080px;
    margin-left: auto;
    margin-right: auto;
    padding-left: 16px;
    padding-right: 16px;
    padding-top: 10px;
    padding-bottom: 10px;
    overflow-y: hidden;
    white-space: nowrap;
    grid-gap: 16px;
    justify-content: center;
    @include breakpoint-up(large) {
        display: grid;
    }
    @include breakpoint-up(medium) {
        display: grid;
        grid-template-columns: 1fr 1fr 1fr;
        max-width: 750px;
        align-items: right;
    }
    @include breakpoint-down(medium) {
        display: grid;
        grid-template-columns: 1.5fr 1.5fr;
        width: 500px;
        margin: auto;
    }
    @include breakpoint-down(small) {
        display: block;
        padding: 0rem;
        margin-left: -20px;
        margin-right: 0;
        padding-left: 30px;
        padding-right: 0px;
        padding-top: 0px;
        padding-bottom: 0px;
    }
    -webkit-overflow-scrolling: touch;
    &::-webkit-scrollbar {
        display: block;
        height: 9px;
        border-radius: 50px;
        @include breakpoint-down(small) {
            display: none;
        }
    }
    &::-webkit-scrollbar-thumb {
        width: 5px;
        border-radius: 50px;
        background: $color2;
        border-radius: 50px;
    }
    .card {
        display: inline-block;
        overflow: hidden;
        transition: all 100ms ease-in-out;
        box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2);
        max-height: 18.5rem;
        min-height: 18.5rem;
        max-width: 12.5rem;
        min-width: 12.5rem;
        margin: 0.2rem;
        padding: 0;
        &:hover .card__visual {
            background: url("../assests/home1.jpeg") no-repeat;
            @include bgConfig;
            transform: scale(0.9);
            box-shadow: 0 8px 16px 0 rgba(0, 0, 0, 0.2);
            height: 14rem;
        }
        &__visual {
            background: url("../assests/home2.jpeg") no-repeat;
            height: 17rem;
            width: 100%;
            @include bgConfig;
            position: relative;
            transition: all .7s ease;
        }
        &__texts {
            padding-top: -1rem;
            cursor: default;
            padding: 0.1rem;
            width: 100%;
            .title {
                margin: -0.1rem;
                padding-left: 1rem;
                font-size: 1rem;
                color: #57606f;
            }
            .subtitle {
                margin: -1.2rem;
                padding: 0;
                text-align: right;
                padding-left: 7.1rem;
                font-size: 0.71rem;
                color: #747d8c;
            }
            .read {
                display: grid;
                margin: 1.8rem;
                text-align: right;
                padding: 0.8rem;
                padding-left: 6rem;
                font-size: 0.71rem;
                color: #747d8c;
            }
        }
        a {
            color: black;
            font-size: 0.7rem;
            padding-left: 7rem;
            margin: 1.2rem;
            cursor: pointer;
            &::before {
                content: "";
                display: block;
                position: absolute;
                height: 0em;
                left: 0;
                right: 0;
                bottom: 0px;
